import React from "react";

function Header1() {
  return (
    <div className="h-1920px w-100  bg-[#071D2B] font-Roboto text-white flex justify-center">
      <div className="my-2">Offers protection against viruses</div>
      <div className="mx-10 my-2">Download Now</div>
    </div>
  );
}

export default Header1;
